	 (144,142,'We''re sorry, the version of iOS on your iPhone is not supported.','We''re sorry, the version of iOS on your iPhone is not supported.','很抱歉，您的iPhone上的iOS版本不受支持。','Nous sommes désolés, la version d''iOS sur votre iPhone n''est pas prise en charge.','Die Version von iOS auf Ihrem iPhone wird nicht unterstützt.','Siamo spiacenti, la versione di iOS sul tuo iPhone non è supportata.','申し訳ありませんが、iPhoneのiOSのバージョンはサポートされていません。','죄송합니다. iPhone의 iOS 버전은 지원되지 않습니다.','К сожалению, версия iOS на вашем iPhone не поддерживается.','Lo sentimos, la versión de iOS en tu iPhone no es compatible.','2019-01-30 11:08:03','2019-02-06 14:03:55',NULL,'text_2'),
	 (109,107,'Please come visit us soon.','Please come visit us soon.','请尽快访问我们。','Sil vous plaît venez nous rendre visite bientôt.','Bitte besuchen Sie uns bald.','Per favore, vieni a trovarci presto.','すぐにお越しください。','곧 우리를 방문하십시오.','Пожалуйста, приходите к нам в ближайшее время.','Por favor venga a visitarnos pronto.','2019-01-30 11:07:43','2019-02-05 16:59:49',NULL,'text_2'),
