	 (108,107,'The Barnes Focus app is meant for use at the Barnes.','The Barnes Focus app is meant for use at the Barnes.','Barnes Focus应用程序适用于Barnes。','L''application Barnes Focus est destinée à être utilisée à Barnes.','Die Barnes Focus App ist für die Verwendung in Barnes bestimmt.','L''app Barnes Focus è pensata per essere utilizzata a Barnes.','バーンズフォーカスアプリはバーンズで使用するためのものです。','Barnes Focus 앱은 Barnes에서 사용하기위한 앱입니다.','Приложение Barnes Focus предназначено для использования в Barnes.','La aplicación Barnes Focus está diseñada para usarse en Barnes.','2019-01-30 11:07:43','2019-02-05 17:10:34',NULL,'text_1'),
